import React, { useEffect } from 'react';
import debounce from 'lodash.debounce';

const DemoPage = () => {
  useEffect(() => {
    const handleScroll = debounce(() => {
      const sections = document.querySelectorAll('.fadeIn');
      const scrollPosition = window.scrollY + window.innerHeight;

      sections.forEach((section, index) => {
        const isVisible = section.offsetTop < scrollPosition - 100;

        if (isVisible) {
          section.classList.add('opacity-100');
          section.classList.add(index % 2 === 0 ? 'animate-bottom-to-top' : 'animate-top-to-bottom');
        } else {
          section.classList.remove('opacity-100');
          section.classList.remove('animate-bottom-to-top', 'animate-top-to-bottom');
        }
      });
    }, 100);

    window.addEventListener('scroll', handleScroll);

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <div className="bg-gray-900 text-white min-h-screen w-full">
      {/* Header Section */}
      <header className="relative py-32 text-center bg-gradient-to-r from-indigo-700 to-blue-800">
        {/* Background Gradient */}
        <div className="absolute top-0 left-0 w-full h-full bg-opacity-60 bg-gradient-to-r from-indigo-800 to-blue-700"></div>

        {/* Main Content */}
        <div className="relative z-10 text-white">
          <h1 className="text-5xl font-extrabold leading-tight tracking-wide mb-4">
            Bienvenue sur <span className="text-transparent bg-clip-text bg-gradient-to-r from-purple-400 to-pink-500">DBVision</span>
          </h1>
          <p className="text-lg text-gray-200 max-w-3xl mx-auto mt-6 leading-relaxed">
            Surveillez et analysez vos bases de donn√©es avec des outils interactifs et des visualisations en temps r√©el, m√™me en pleine nuit.
          </p>
        </div>
      </header>

      {/* Features Section */}
      <section className="py-24 px-6 sm:px-8 lg:px-12 space-y-12 bg-gray-800">
        <div className="fixed top-0 right-0 h-0 w-1 bg-purple-500 z-50 scrollProgressLine transition-all duration-300"></div>

        {/* Feature Cards */}
        {[{
            title: "Tableaux de Bord Interactifs",
            description: "Visualisez vos donn√©es en temps r√©el avec des graphiques interactifs qui se mettent √† jour dynamiquement.",
            icon: "üìä",
          },
          {
            title: "G√©rer Vos Donn√©es",
            description: "Modifiez, filtrez et analysez vos donn√©es de mani√®re intuitive avec des outils puissants.",
            icon: "‚öôÔ∏è",
          },
          {
            title: "Mises √† Jour en Temps R√©el",
            description: "Restez inform√© de la sant√© de votre base de donn√©es avec des mises √† jour en direct.",
            icon: "‚è±Ô∏è",
          },
        ].map((feature, index) => (
          <div
            key={index}
            className="bg-gray-700 rounded-lg shadow-xl p-8 opacity-0 fadeIn transform transition-opacity duration-1000 animate__animated animate__fadeIn animate__delay-2s"
          >
            <div className="flex items-center mb-4">
              <div className="text-4xl mr-4 text-purple-500">{feature.icon}</div>
              <h3 className="text-2xl font-semibold text-purple-400">{feature.title}</h3>
            </div>
            <p className="text-gray-300 text-lg">{feature.description}</p>
          </div>
        ))}
      </section>

      {/* Monitoring Section */}
      <section className="py-24 px-6 sm:px-8 lg:px-12 space-y-12 bg-gray-800">
        <h2 className="text-4xl font-semibold text-purple-400 text-center mb-6">
          Surveillance des Bases de Donn√©es en Temps R√©el
        </h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
          {[{
              title: "Analyse de Performance",
              icon: "üìà",
              description: "Suivez la sant√© de votre base de donn√©es en temps r√©el avec des graphiques d√©taill√©s.",
            },
            {
              title: "Utilisation des Donn√©es",
              icon: "üíæ",
              description: "Visualisez et suivez l'utilisation du stockage de vos donn√©es.",
            },
            {
              title: "Vue d'Ensemble des Requ√™tes",
              icon: "üîç",
              description: "Analysez les requ√™tes fr√©quentes et leur impact sur les performances.",
            },
          ].map((item, index) => (
            <div
              key={index}
              className="bg-gray-700 p-6 rounded-lg shadow-xl opacity-0 fadeIn transform transition-opacity duration-1000 animate__animated animate__fadeIn animate__delay-3s"
            >
              <div className="text-4xl mb-4 text-purple-500">{item.icon}</div>
              <h3 className="text-2xl font-semibold text-purple-400 mb-2">{item.title}</h3>
              <p className="text-gray-300">{item.description}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Call-to-Action Section */}
      <section className="flex justify-center py-12 bg-gradient-to-r from-indigo-800 to-blue-700">
        <button
          className="bg-purple-600 hover:bg-purple-700 text-white text-xl font-semibold py-4 px-10 rounded-full shadow-lg transform hover:scale-105 transition-transform duration-300 animate__animated animate__zoomIn"
          onClick={() => window.location.href = '/login'}
        >
          Connecter Votre Base de Donn√©es
        </button>
      </section>

      {/* Footer Section */}
      <footer className="py-6 text-center bg-gray-900">
        <p className="text-gray-400 text-sm">
          DBVision - Tous droits r√©serv√©s | &copy; {new Date().getFullYear()}
        </p>
      </footer>
    </div>
  );
};

export default DemoPage;
